import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { ArrowLeft, Clock, MapPin, Users, Info, CheckCircle } from 'lucide-react';

const EventDetails = ({ allEvents, theme, onRegister }) => {
  const { id } = useParams();
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  // Find the specific event from the central state
  const event = allEvents.find(e => e.id === parseInt(id));

  if (!event) return <div style={{ padding: '20px', textAlign: 'center' }}>Event not found</div>;

  const styles = {
    container: {
      maxWidth: '430px',
      margin: '0 auto',
      minHeight: '100vh',
      backgroundColor: isDark ? '#0f172a' : '#fff',
      color: isDark ? '#fff' : '#1e293b',
      position: 'relative'
    },
    header: {
      position: 'absolute',
      top: '20px',
      left: '20px',
      zIndex: 10,
      backgroundColor: 'rgba(255,255,255,0.8)',
      borderRadius: '50%',
      padding: '8px',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center'
    },
    image: { width: '100%', height: '300px', objectFit: 'cover' },
    content: {
      padding: '24px',
      marginTop: '-30px',
      backgroundColor: isDark ? '#0f172a' : '#fff',
      borderTopLeftRadius: '30px',
      borderTopRightRadius: '30px',
      position: 'relative'
    },
    footer: {
      padding: '20px',
      borderTop: isDark ? '1px solid #1e293b' : '1px solid #f1f5f9',
      position: 'sticky',
      bottom: 0,
      backgroundColor: isDark ? '#0f172a' : '#fff'
    }
  };

  return (
    <div style={styles.container}>
      {/* Back Button */}
      <div style={styles.header} onClick={() => navigate(-1)}>
        <ArrowLeft size={24} color="#000" />
      </div>

      <img src={event.image} alt={event.title} style={styles.image} />

      <div style={styles.content}>
        <span style={{ backgroundColor: '#5c5cfc', color: '#fff', padding: '4px 12px', borderRadius: '8px', fontSize: '12px', fontWeight: 'bold' }}>
          {event.category}
        </span>
        <h1 style={{ fontSize: '26px', fontWeight: 'bold', margin: '12px 0' }}>{event.title}</h1>

        <div style={{ display: 'flex', flexDirection: 'column', gap: '15px', marginBottom: '25px' }}>
          <div style={{ display: 'flex', gap: '12px', alignItems: 'center' }}>
            <Clock size={20} color="#5c5cfc" />
            <span style={{ fontSize: '14px' }}>{event.date}</span>
          </div>
          <div style={{ display: 'flex', gap: '12px', alignItems: 'center' }}>
            <MapPin size={20} color="#5c5cfc" />
            <span style={{ fontSize: '14px' }}>{event.location}</span>
          </div>
          <div style={{ display: 'flex', gap: '12px', alignItems: 'center' }}>
            <Users size={20} color="#5c5cfc" />
            <span style={{ fontSize: '14px' }}>45 Seats Left (Filling fast!)</span>
          </div>
        </div>

        <h3 style={{ fontSize: '18px', fontWeight: 'bold', marginBottom: '10px' }}>About Event</h3>
        <p style={{ color: '#64748b', lineHeight: '1.6', fontSize: '14px' }}>
          Join this exclusive event to explore {event.title}. Industry experts will share insights into the latest trends. Lunch and participation certificates will be provided.
        </p>
      </div>

      <div style={styles.footer}>
        {/* ONLY SHOW REGISTER BUTTON IF NOT REGISTERED */}
        {!event.isRegistered ? (
          <button 
            style={{ width: '100%', backgroundColor: '#2563eb', color: '#fff', padding: '16px', borderRadius: '16px', border: 'none', fontWeight: 'bold', fontSize: '16px' }}
            onClick={() => { onRegister(event.id); navigate('/my-events'); }}
          >
            Register Now
          </button>
        ) : (
          <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', gap: '10px', color: '#16a34a', fontWeight: 'bold', padding: '16px' }}>
            <CheckCircle size={24} /> Already Registered
          </div>
        )}
      </div>
    </div>
  );
};

export default EventDetails;
